## Remarks  
 Podczas pracy z wartością właściwości parametry wielowartościowe <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> metoda spowoduje pomyślne usunięcie odpowiedniej pozycji. Identyfikowanie odpowiednie elementy według nazwy jest jednak trudne o wielu wartościach wartości właściwości DNWithString (zgodnie z klasy DNWithString COM, który służy do przechowywania elementów DNWithString ma 2 właściwości ciągu reprezentujący element). Sposobem usunięcia tych elementów jest można znaleźć obiektu w kolekcji (przez odtwarzanie w pętli do wszystkich elementów), następnie wywołać <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> funkcji za pomocą wskaźnika obiektu, który właśnie uzyskała.  Jest to zilustrowane w poniższym przykładzie.  
  
   
  
## Examples  
  
```csharp  
  
// Bind to the AD object  
DirectoryEntry myUser = new DirectoryEntry("LDAP://AdServer:389/CN=MyUsername,CN=Users,DC=contoso,DC=com");  
  
// Get the attribute  
PropertyValueCollection testAttribute = myUser.Properties["someAttribute"];  
  
// Find the item in the collection that we want to delete  
DNWithString dnwsItemToRemove = null;  
foreach (DNWithString dnwsItem in testAttribute)  
{  
    if (dnwsItem.StringValue.Equals("SomeValue"))  
    {  
        dnwsItemToRemove = dnwsItem;  
        break;  
    }  
}  
  
// Delete it  
testAttribute.Remove(dnwsItemToRemove);  
  
// Store the data  
myUser.CommitChanges();  
```
